el__leafmedia--sourced-paragraph\">\r\n<p class=\"zn-body__paragraph\">New York City and Philadelphia have been spared the worst of a nor\'easter, but the storm waswalloping other parts of the region with heavy snow and high winds. Millions of people were still in the path of blizzard conditions.</p>\r\n</div>\r\n<div class=\"zn-body__paragraph\">The storm brought chaos to travel and daily life, with about<span> </span>8,800 US flights canceled between Monday and Wednesday and thousands of schools closed. Connecticut banned highway travel for several hours Tuesday, and some major regional rail traffic was suspended. Four weather-related deaths were reported in three states.</div>\r\n<div class=\"el__embedded el__embedded--fullwidth\">\r\n<div class=\"element-raw appearance-fullwidth\">\r\n<div id=\"storm-tracker\"><iframe src=\"http://www.cnn.com/interactive/storm-tracker/embed.html?initialWidth=780&amp;childId=storm-tracker&amp;parentTitle=Millions%20still%20under%20blizzard%20warning%20in%20Northeast%20-%20CNN.com&amp;parentUrl=http%3A%2F%2Fwww.cnn.com%2F2017%2F03%2F14%2Fus%2Fnortheast-winter-weather%2F\" frameborder=\"0\" marginheight=\"0\" scrolling=\"no\" width=\"100%\" height=\"472px\"></iframe></div>\r\n</div>\r\n</div>\r\n<div class=\"zn-body__paragraph\">Normalcy trickled back as some train services and flights resumed Tuesday evening. But a blizzard warning remained in<span> </span>effect for parts of Pennsylvania, upstate New York and most of New England. The warning affected nearly 5 million people, the National Weather Service said.</div>\r\n<p> </p>\r\n<div class=\"el__embedded el__embedded--standard\"> </div>',NULL,NULL,1489545092),(25,'Admin sent you connection request','I would like to connect you',NULL,NULL,1489562841),(26,'Admin sent you connection request','I would like to connect you, please add me',NULL,NULL,1489577701),(27,'felicity sent you connection request','I would like to connect you, please add me',NULL,NULL,1489580151),(28,'felicity sent you connection request','I would like to connect you, please add me',NULL,NULL,1489580248),(30,'RE:diggle sent you connection request','<p>hello felicity</p>',NULL,NULL,1489647630),(31,'hello','<p>hello iris</p>',NULL,NULL,1489648067),(32,'iris sent you connection request','I would like to connect you, please add me',NULL,NULL,1489663265),(33,'Robert sent you connection request','I would like to connect you, please add me',NULL,NULL,1489732306),(34,'RE:Robert sent you connection request','<p>hello</p>',NULL,NULL,1489737206),(35,'RE:RE:Robert sent you connection request','<p>hello</p>',NULL,NULL,1489737252),(36,'hello','<p>hello<strong> just check</strong></p>',NULL,NULL,1489752237),(37,'Robert sent you connection request','I would like to connect you, please add me',NULL,NULL,1490015725),(39,'anakin sent you connection request','I would like to connect you, please add me',NULL,NULL,1490087706),(50,'Ricky sent you connection request',' \n			 Hello {$a->	receiveuser},<br>\n			Ricky would like to establish a connection link with you. <br>\n			Profile : <a href=\"http://4blabs.com/scw/local/mylinks/profile.php?user_id=3\">Click here</a>',NULL,NULL,1490370965),(51,'Ricky sent you connection request',' \n			 Hello {$a->	receiveuser},<br>\n			Ricky would like to establish a connection link with you. <br>\n			Profile : <a href=\"http://4blabs.com/scw/local/mylinks/profile.php?user_id=3\">Click here</a>',NULL,NULL,1490371330),(54,'Ricky sent you connection request','Hello Terry\n			Ricky would like to establish a connection link with you.',NULL,NULL,1490372246),(75,'Nandini sent you connection request','Hello AJ,\n			Nandini would like to establish a connection link with you.',NULL,NULL,1491893403),(81,'RE:kamesh sent you connection request','<p>ddddddddddddddd</p>',NULL,NULL,1491895957),(91,'shiny sent you connection request','Hello Vincent,\n			shiny would like to establish a connection link with you. <br>\n			Profile : <a href=\"http://4blabs.com/scw/local/mylinks/profile.php?user_id=67\">Click here</a> <br>\n			\n			Instructions: Click on Profile to view and confirm connect.	',NULL,NULL,1494590975),(99,'cc test 0513','<p>0513 test</p>',NULL,NULL,1494656956),(100,'Test two','<p>Test two</p>',NULL,NULL,1494657076),(101,'walker cc test','<p>cc test three</p>',NULL,NULL,1494657171),(102,'Terry sent you connection request','Hello Roger,\n			Terry would like to establish a connection link with you. <br>\n			Click <a href=\"http://4blabs.com/scw/local/mylinks/profile.php?user_id=10\">Profile</a> to view and confirm connect<br>',NULL,NULL,1583232046),(103,'March SCW Event','<p>I heard an SCW event is organized on March 20, 2020.</p>\r\n<p>Please find the details below.</p>\r\n<h3>American Supply Chain Summit 2020</h3>\r\n<p><span><a class=\"exit\" href=\"https://supplychainus.com/\" target=\"_blank\">Visit the Website</a></span><br /><span>When</span>: May 5-6, 2020<br /><span>Where</span>: Dallas, TX<br /><br /><span>Who Should Attend</span>: For those currently managing the supply chain, logistics and/or procurement<br /><br /><span>The Conference in Their Words</span>: The American Supply Chain Summit is a leadership-focused meeting designed around improving supply chain and procurement strategy across the globe. This event serves as an annual platform to exchange ideas and collaborate on the impact of market dynamics and new technologies for current and future supply chain and operations leaders. This year’s Summit creates an opportunity to examine key case studies on how workforce management, advanced analytics, process improvement, and automation are being rolled out in the world’s best facilities. Join the in-depth discussions on achieving innovation, maximizing supply chain profitability and increasing visibility and flexibility to mitigate risk.<br /><br /><span>Featured Speakers</span>:<br />• Rachel Kutz, VP, Strategic Initiatives, Global Supply Chain - AT&amp;T<br />• Stacy Green, SVP, Supply Chain - Coca-Cola Southwest Beverages<br />• Ann Tracy, VP Safety, Sustainability, and Supply Chain Strategy - Colgate-Palmolive<br />• Massimo Sapone, SVP, Planning, and Logistics, North America - Luxottica<br />• Sean Trainor, SVP, Supply Chain and Operations - Visionworks of America<br />• Cindy Mead, Chief Management Systems Branch, Safety and Mission Assurance Directorate - NASA Goddard Space Flight Center</p>',NULL,NULL,1583233068);
