INSERT INTO `scwxm_local_scwevents` VALUES (1,'Gartner Supply Chain Executive Conference 2017','<p><strong>Gartner Supply Chain Executive Conference 2017</strong></p>\r\n<p><strong><img src=\"@@PLUGINFILE@@/gartner%20Screen-Shot-2015-11-09-at-10.39.01-AM.png\" alt=\"ev1\" width=\"402\" height=\"168\" /></strong></p>\r\n<h2 class=\"level3\">The World\'s Most Important Gathering of Supply Chain Leaders and Their Teams</h2>\r\n<p class=\"summary\">Disruptions large and small confront today’s supply chains on a daily basis and organizational survival depends on the ability to anticipate, adapt and transform supply chains to deliver reliability and performance. At this year’s Gartner Supply Chain Executive Conference, Chief Supply Chain Officers and their teams learn how to recognize the impacts of disruptions and create transformational strategies that empower the organization. </p>\r\n<p class=\"summary\"><img src=\"@@PLUGINFILE@@/mars_homepage01.jpg\" style=\"float: right;\" width=\"310\" height=\"110\" /><br /> </p>\r\n<ul class=\"bullet\">\r\n<li>Identify must-have innovations to support the supply chain of the future</li>\r\n<li>Foster solutions for next-generation supply chains with best-in-class talent and organizational strategies</li>\r\n<li>Understand the rise of the Chief Robotics Officer and how to prepare</li>\r\n<li>Get the latest best practices in supply chain management and logisitics</li>\r\n</ul>',1,'GB','AZ','Phoenix','@Gartner_inc\r\n',1490868000,1494756000,1,1,1489831842,1494603230,2,2,1),(2,' Midwest Association of Rail Shippers Winter Meeting 2017','<h1><img src=\"@@PLUGINFILE@@/mars_logo.jpg\" width=\"310\" height=\"302\" />Shippers Winterz$</h1>\r\n<p>The Midwest Association of Rail Shippers (MARS) seeks to “provide an open forum for resolving transportation and car supply problems,” along with educational programs for its membership regarding railroad operating practices, transportation innovations, and legislative matters. Their supply chain management conferences take place twice a year, with the first occurring in January 2017 in Oakbrook, Illinois. The MARS Winter Meeting features a reception, new member orientation, and sessions on key industry topics.</p>\r\n<p> </p>\r\n<p>he Midwest Association of Rail Shippers (MARS) seeks to “provide an open forum for resolving transportation and car supply problems,” along with educational programs for its membership regarding railroad operating practices, transportation innovations, and legislative matters. Their supply chain management conferences take place twice a year, with the first occurring in January 2017 in Oakbrook, Illinois. The MARS Winter Meeting features a reception, new member orientation, and sessions on key industry topics.he Midwest Association of Rail Shippers (MARS) seeks to “provide an open forum for resolving transportation and car supply problems,” along with educational programs for its membership regarding railroad operating practices, transportation innovations, and legislative matters. Their supply chain management conferences take place twice a year, with the first occurring in January 2017 in Oakbrook, Illinois. The MARS Winter Meeting features a reception, new member orientation, and sessions on key industry topics.he Midwest Association of Rail Shippers (MARS) seeks to “provide an open forum for resolving transportation and car supply problems,” along with educational programs for its membership regarding railroad operating practices, transportation innovations, and legislative matters. Their supply chain management conferences take place twice a year, with the first occurring in January 2017 in Oakbrook, Illinois. The MARS Winter Meeting features a reception, new member orientation, and sessions on key industry topics.<img src=\"@@PLUGINFILE@@/mars_homepage01.jpg\" width=\"310\" height=\"110\" /></p>\r\n<p><strong>Cost to Attend:</strong></p>\r\n<ul>\r\n<li>Standard Conference: $2,095 by December 16</li>\r\n<li>Standard Conference plus Flash Drive: $2,195 by December 16</li>\r\n<li>Hospital &amp; Health Systems Conference: $895 by December 16</li>\r\n<li>Hospital &amp; Health Systems Conference plus Flash Drive: $995 by December 16</li>\r\n<li>Academic Conference: $895 by December 16</li>\r\n<li>Academic Conference plus Flash Drive: $995 by December 16</li>\r\n</ul>\r\n<p> </p>',1,'GB',' IL','Oak Brook  ','OakBrook IL',1490868600,1494875400,1,1,1489832262,1494603080,2,2,1),(3,'Global Cold Chain Expo Supply Chain Innovation Summit','<p><strong>The Supply Chain Innovation Summit takes place in mid-November 2016, so check back for more information on</strong> the 2017 event date and location. What we do know is that this supply chain conference is a must-attend event for supply chain managers and organizations looking to hear from some of the world’s leading senior executives in supply chain and inventory management. Focusing on supply chain innovation and technology, the Supply Chain Innovation Summit features tools, techniques, data, interactive workshops, networking opportunities, and more for attendeesThe Supply Chain Innovation Summit takes place in mid-November 2016, so check back for more information on the 2017 event date and location. What we do know is that this supply chain conference is a must-attend event for supply chain managers and organizations looking to hear from some of the world’s leading senior executives in supply chain and inventory management. Focusing on supply chain innovation and technology, the Supply Chain Innovation Summit features tools, techniques, data, interactive workshops, networking opportunities, and more for attendeesThe Supply Chain Innovation Summit takes place in mid-November 2016, so check back for more information on the 2017 event date and location. What we do know is that this supply chain conference is a must-attend event for supply chain managers and organizations looking to hear from some of the world’s leading senior executives in supply chain and inventory management. Focusing on supply chain innovation and technology, the Supply Chain Innovation Summit features tools, techniques, data, interactive workshops, networking opportunities, and more for attendees</p>',1,'GB','OHia ','London','Gulmohar hall,\r\nEast London',1490436900,1492164900,1,1,1489834441,1491560109,2,2,1),(4,'11th Annual Health Care Supply Chain Management Summit','<p><strong><a href=\"http://www.worldcongress.com/events/HL17006/\" rel=\"noreferrer\" target=\"_blank\">11th Annual Health Care Supply Chain Management Summit</a><br /></strong><a href=\"https://twitter.com/Wrldhealthcare\" rel=\"noreferrer\" target=\"_blank\">@WrldHealthcare</a></p>\r\n<p>The 11th Annual Health Care Supply Chain Management Summit will take place in January 2017 in New Orleans, Louisiana. This supply chain management event features executive networking opportunities and distinguished and expert speakers. Health Care Supply Chain Management Summit sessions in 2017 will be geared toward strategies for optimizing contracting, logistics, and value analysis supply chain operations. Attendees of this supply chain conference will engage in in-depth discussion of benchmarking strategies for achieving “the next frontier of supply chain operations.”</p>\r\n<p><strong>Cost to Attend:</strong></p>\r\n<ul>\r\n<li>Standard Conference: $2,095 by December 16</li>\r\n<li>Standard Conference plus Flash Drive: $2,195 by December 16</li>\r\n<li>Hospital &amp; Health Systems Conference: $895 by December 16</li>\r\n<li>Hospital &amp; Health Systems Conference plus Flash Drive: $995 by December 16</li>\r\n<li>Academic Conference: $895 by December 16</li>\r\n<li>Academic Conference plus Flash Drive: $995 by December 16</li>\r\n</ul>\r\n<p> </p>\r\n<p>The 11th Annual Health Care Supply Chain Management Summit will take place in January 2017 in New Orleans, Louisiana. This supply chain management event features executive networking opportunities and distinguished and expert speakers. 