al improvements</p>\r\n<p>3. Automate reporting</p>\r\n<p><strong>Time:</strong> 10.00am – 2.00pm</p>\r\n<p><strong>Provided:</strong> Free tea / coffee, notepads, pens, snacks and a smile!</p>\r\n<p><strong>Bring: </strong>A heart for learning &amp; optional laptop / iPad</p>\r\n<p><strong>Location: </strong>Huckletree, 18 Finsbury Square, Central London, EC2A 1AH, United Kingdom</p>\r\n<p><strong>Why Should I come?</strong></p>\r\n<ul>\r\n<li>Extend your CV</li>\r\n<li>Make a difference to your business</li>\r\n<li>Better supplier management through increased understanding</li>\r\n<li>Get ahead of the curve</li>\r\n<li>One to one Q&amp;A to end – bring your issues and frustrations!</li>\r\n</ul>\r\n<p><strong>Who Should Attend?</strong></p>\r\n<ul>\r\n<li>Marketing Managers</li>\r\n<li>Ecommerce Managers</li>\r\n<li>Social Media Managers</li>\r\n<li>Web Devs &amp; Designers</li>\r\n<li>B2B &amp; B2C</li>\r\n<li>SME’s &amp; Corporates</li>\r\n<li>Transactional (ecom), Brochure &amp; Lead Gen Sites</li>\r\n<li>Business Owners</li>\r\n<li>Account Managers</li>\r\n</ul>\r\n<p>We’ve had a whole range of businesses attending, from start-ups founders &amp; local business owners, to senior Ecommerce Retailers &amp; global platforms. There’s something for everyone!</p>\r\n<p>For more information, please check the official event page:</p>\r\n<p>http://bit.ly/2pcVlfs and GET YOUR TICKET DIRECTLY FROM<a href=\"http://bit.ly/2pcVlfs\"> HERE</a><br /> Tickets available from £145</p>\r\n<p><strong>Our Speakers</strong></p>\r\n<p>All of our speakers are marketing industry experts, who are both actively working on Google Analytics and experienced in sharing it. Challenge them with the obvious and the technical, they’ve got it covered.<br /> See you there<br /><br /><img src=\"@@PLUGINFILE@@/16-problem-is-only-problem-Robin-Sharma-Quotes.jpg\" width=\"600\" height=\"310\" /></p>',1,'GB','State','City','Address of the event',1494602400,1494775200,0,1,1494602946,1494605542,2,2,1),(34,'Test event1','<p><span>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span></p>',1,'GB','London','London','Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC.',1504605600,1505901600,1,1,1504605819,1504605819,2,2,1),(35,'Test event2','<p><span>There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words.</span></p>',1,'IN','TamilNadu','Madurai','making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia.',1504605600,1505642400,1,1,1504605891,1504605891,2,2,1),(36,'Jump Start 20','<p><span>The Conference in Their Words</span>: Jump Start explores emerging trends, current challenges and new innovations in the supply chain. It touches virtually every aspect of today’s modern, complex supply chain. As the definitive supply chain intelligence gathering of the new year, Jump Start is a one-of-a-kind experience that blends informative panels, from industry experts with top-tier networking opportunities.<br /><span></span></p>\r\n<p><span><strong>Who Should Attend</strong>: Carriers, shippers, logistics service providers and technology providers<br /><strong>Featured Speakers</strong></span><strong>:</strong><br />• Joe Theisman, Super Bowl Champion<br />• Dr. Romie Mushtaq, MD, ABIHM, Physician, Speaker, Chief Wellness Officer<br />• George Abernathy, President, <a href=\"https://www.freightwaves.com/\" target=\"_blank\" class=\"exit\">FreightWaves</a><br />• Rick DiMaio, SVP, Supply Chain, Office Depot<br />• Derek Leathers, President &amp; CEO, Werner Enterprises<br />• And many others</p>',1,'US','Georgia','Atlanta','THE RENAISSANCE ATLANTA WAVERLY\r\n2450 Galleria Parkway, Atlanta, GA 30339',1585300800,1585506000,1,1,1574151990,1583218937,2,2,0),(37,'Ecommerce Operations Summit','<p><span>The only conference exclusively about direct-to-customer and omnichannel operations and fulfillment — The Ecommerce Operations Summit provides insight and ideas to help your entire DTC operations achieve efficiencies and improved customer experiences. From warehousing and workforce management, e-commerce and contact centers, inventory and order management to payment processing; from the pick, pack, and ship to delivery and returns; technology, automation, and systems integration, to transportation and global operations. All need to come together to create one seamless, cost-efficient, customer-centric operation.</span><span><br /></span></p>\r\n<p><span><strong>Who Should Attend</strong>: Anyone interested in improving their omnichannel/DTC operations and fulfillment processes<br /><strong>Featured Speakers</strong>:<br /></span><span>• Willis Weirich, SVP, Supply Chain &amp; Operations, Neiman Marcus</span><br /><span>• Rick Bingle, EVP, Global Supply Chain, REI Co-op</span></p>\r\n<p><strong>Ecommerce Operations Summit 2020 is the only event that is devoted exclusively to every area of omnichannel and DTC operations &amp; fulfillment, including:</strong></p>\r\n<ul>\r\n<li>Delivering a Seamless Customer Experience</li>\r\n<li>Improving Cross-Departmental Process and Communication Issues Between Operations, E-commerce, and Marketing</li>\r\n<li>Benchmark Data to Measure Efficiencies</li>\r\n<li>Supply Chain Optimization</li>\r\n<li>Omnichannel Strategy</li>\r\n<li>Peak Season Planning and Staffing</li>\r\n<li>Free Shipping</li>\r\n<li>Returns</li>\r\n<li>And so much more…</li>\r\n</ul>',1,'US','Florida','Orlando','Hotel\r\nMarriott Orlando World Center\r\n8701 World Center Dr.\r\nOrlando, FL 32821\r\n(407) 239-4200',1586860200,1587069000,1,1,1583217793,1583218877,2,2,0),(38,'WERC 2020','<p><span>Behind every forklift, scanned the label and slotting software is a logistics professional dedicated to keeping the supply chain moving. WERC’s Annual Conference and Solutions Center are where they come to refuel on ideas, knowledge, and solutions. Join your peers from across the country and beyond to discover excellence and innovation.</span></p>\r\n<p><strong>Who Should Attend</strong><strong>:</strong> Logistics professionals who are looking to obtain new tools, strategies,<img src=\"@@PLUGINFILE@@/Agenda.png\" width=\"1253\" height=\"6637\" /> and insights to improve supply chain operations</p>',1,'US','Rhode Island',' Providence',' Providence, RI',1588502400,1588761600,1,1,1583218754,1583218834,2,2,0);
