INSERT INTO `scwxm_local_scwinterviews` VALUES (1,'Linux Engineers ','<p><img src=\"@@PLUGINFILE@@/download2.png\" width=\"161\" height=\"126\" /></p>\r\n<p>Syslint Technologies - India </p>\r\n<p>Fresher</p>\r\n<p>Qualification : B.E/ B.Tech/ MCA/ M.Tech. <br /><br />Experience / Freshers <br /><br />Required Skills </p>\r\n<ul type=\"disc\">\r\n<li>Should be a graduate</li>\r\n<li>Advanced knowledge ofLinux</li>\r\n<li>Good knowledge on cPanel/WHM</li>\r\n<li>Knowledge of shell scripting</li>\r\n<li>Excellent problem solving skills and troubleshooting skills</li>\r\n<li>Flexible schedule.</li>\r\n<li>Should have good Written and Communication Skill</li>\r\n</ul>','Allen Jospeh','Syslint Technologies',3,1,0,1492646400,1489826384,1492079763,2,2,1),(2,'Required Technical support engineer immediately ','<p>Genpact - Gurgaon, Haryana </p>\r\n<p>₹20,000 a month</p>\r\n<p>24*7 PC Hardware, Networking, Troubleshooting, OS Support</p>\r\n<p>Location: Noida</p>\r\n<p>Experience: 0 - 2 Years Facilities: Cab and Meal Provided Job Summary Provide 24*7 Online, Remote ethical tech support relate to Technical support services of PC Hardware, Desktop, Laptop, Networking, Antivirus, Bug Fixing, OS support, diagnosis, repair and performance optimization. US Shift Timings. Salary upto Rs.22500</p>\r\n<p>Job Type: Full-time</p>\r\n<p>Salary: ₹20,000.00 /month</p>\r\n<p>Job Location:</p>\r\n<ul type=\"disc\">\r\n<li>Noida, Uttar Pradesh</li>\r\n</ul>\r\n<p>Required education:</p>\r\n<ul type=\"disc\">\r\n<li>High school or equivalent</li>\r\n</ul>\r\n<p>Required experience:</p>\r\n<ul type=\"disc\">\r\n<li>fresher to: 1 year</li>\r\n</ul>\r\n<p>Required language:</p>\r\n<ul type=\"disc\">\r\n<li>Hindi, English</li>\r\n</ul>','suren','Genpact',3,1,0,1492819200,1489826610,1492079794,2,2,1),(3,'Network support Engineer, Fresher ','<p><img src=\"@@PLUGINFILE@@/download1.jpg\" width=\"282\" height=\"179\" /></p>\r\n<p>Accel Frontline Limited - Bangalore, Karnataka </p>\r\n<p>₹13,00,000 a year - Fresher</p>\r\n<ul type=\"disc\">\r\n<li>Freshers with Good communication skills &amp; good attitude.</li>\r\n<li>Basic knowledge in Hardware &amp; networking</li>\r\n<li>Interested to work anywhere in India</li>\r\n</ul>\r\n<p>Salary: ₹1,300,000.00 /year</p>\r\n<p>Required experience:</p>\r\n<ul type=\"disc\">\r\n<li>0-1: 1 year</li>\r\n</ul>','Lori Anderson','Accel Frontline',4,1,1,1492560000,1489826878,1491993493,2,2,1),(4,'Freshers for Embedded, VLSI, RF Engineers form ECE ','<p>Freshers for Embedded, VLSI, RF Engineers </p>\r\n<p>Job Type: Fresher</p>\r\n<p>Salary: ₹8,000.00 /month</p>\r\n<p>Job Location:</p>\r\n<ul type=\"disc\">\r\n<li>Hyderabad, Andhra Pradesh</li>\r\n</ul>\r\n<p>Required education:</p>\r\n<ul type=\"disc\">\r\n<li>Bachelor\'s</li>\r\n</ul>','Asha Lenin','Planet Sigma',15,1,0,1492646400,1489826961,1490877072,2,2,1),(5,'Trainee Engineer ','<p>Nakshatech Private Limited – Bangalore, Karnataka</p>\r\n<ul type=\"disc\">\r\n<li>Autocad knowledge</li>\r\n<li>Graduation in science or diploma-BCA/BCS/Bsc</li>\r\n<li>Knowledge in all MS packages</li>\r\n<li>Training Period- one month</li>\r\n<li>Must work with a team</li>\r\n<li>Good communication skill</li>\r\n</ul>\r\n<p>Qualification: - MSc in Geology.</p>\r\n<p>You have to bring your updated Resume, Passport Size Photograph, Copies of the testimonials substantiating your qualification, your college and your experience.</p>\r\n<p>Freshers Required. MSc in Geology</p>','Mahalakshmi.k','Nakshatech Private Limited',5,1,0,1492214400,1489832287,1489832287,2,2,1),(6,'BE Engineer with MBA - Fresher/Trainee ','<p>ZESOL - Bangalore, Karnataka <br /> Full-time, Fresher</p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td width=\"602\">\r\n<p>MBA fresher with BE background required.</p>\r\n<p>We are a start up in the product development and research space, and tasks will involve market research, SCM, general management activities</p>\r\n<p>We want candidates who are career oriented and would like to add value to the resume. Not the candidates who are looking for monetary benefit alone.</p>\r\n<p>Probationary Salary including bonus - 100000 p.a.</p>\r\n<p>Probation Period - 3 to 6 months</p>\r\n<p>Job Type: Full-time</p>\r\n<p>Job Location:</p>\r\n<ul type=\"disc\">\r\n<li>Bangalore, Karnataka</li>\r\n</ul>\r\n<p>Required education:</p>\r\n<ul type=\"disc\">\r\n<li>Master\'s</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>','Ivo','ZESOL ',7,1,0,1492387200,1489835442,1491379779,2,2,1),(7,'Junior Engineer ','<p>we are looking for a candidate who can work full time/ part time with us. we are into fire &amp; safety products. we are looking for application engineer. simple work procedure. 12th above and diploma are preferred with basic english and kannada language.</p>\r\n<p>Job Type: Fresher</p>\r\n<p>Salary: ₹10,000.00 /month</p>\r\n<p>Required language:</p>\r\n<p>Kannada, english</p>','Jotihkannan','Fourbends',20,1,0,1492387200,1489842137,1491379779,18,2,1),(8,'Experienced Walk-In : Windows Administrator / AD Administrator @ Bangalore','<p><strong class=\"bbc\"><img src=\"@@PLUGINFILE@@/cts.png\" width=\"318\" height=\"159\" /></strong></p>\r\n<p>Job Position :Windows Administrator / AD Administrator<br /><br />Job Designation :Windows Admin and AD Admin<br /><br />Job Category :IT / Software<br /><br />Job Location(s) :Bangalore / Chennai / Pune<br /><br />Interview Location(s) :Bangalore / Coimbatore<br /><br />Desired Qualification :<br />• Minimum 15 Years / 16 Years Of Regular (Academic) Education, 10[SSLC]+2+PUC+3 or 4 [Bachelors]<br />• Arts graduate are not eligible.<br /><br />Desired Experience :2 to 4 Years(Mandatory)<br /><br />Mandatory Skills :Windows, ADS, Active directory, DNS, DHCP<br /><br />Desired Skills :<br />• Basic concepts of Active Directory.<br />• FSMO roles in active directory<br />• Pre-requisite for installation of AD<br />• Difference between local, global and universal groups<br />• Knowledge on Group Policy<br />• Difference between FAT and NTFS on a local machine<br />• Knowledge on RAIDS<br />• Knowledge on WINS, DNS and DHCP<br />• Knowledge on Administration of Antivirus tool.<br />• Knowledge on Deployment tools<br />• Troubleshooting of Network problems.<br />• Exposure to backup Tools, WSUS or SMS.<br /><br />Job Description :<br />• We have multiple openings for Windows Admin and AD Admin Professionals in Bangalore/Chennai/Pune location.<br />If you find yourself suitable please walk-in on below given Venues<br />• Work Location: Candidates can choose to work in any of these locations Bangalore/Chennai/Pune.<br />• Working Hours: 24/7 Rotational Shifts <br /><br />Note : Please ignore this mail if you have taken up a discussion with Cognizant in the last 6 months.<br /><br />Please Carry (mandatory) :<br />• Photocopy of your Resume<br />• Proof of residence (Drivers license / Electricity bill / Ration card, etc)<br /><br />Walk-In Venue :<br /><br />For Bangalore candidates Interview Venue:<br /><br />Cognizant Technology Solutions,<br />65/2, Bagmane Tech Park,<br />C.V Raman Nagar,<br />Bangalore 560093<br />Landmark: Adjacent to LRDE<br />(5th Floor IT Infrastructure Services)<br /><br />For Coimbatore candidates Interview Venue:<br /><br />Cognizant Technology Solutions,<br />C3 - CHIL Special Economic Zone,<br />Keeranatham Village,<br />Saravanampatti via,<br />Coimbatore- 641035<br /><span><br /></span></p>','Prabu','Cognizant Technology Solutions',3,1,0,1493424000,1490339974,1492008946,2,2,1),(9,'WALK IN - Technical Support Associate, HYD','<p><img src=\"@@PLUGINFILE@@/ibm.png\" width=\"311\" height=\"162\" /></p>\r\n<p><span>We are seeking [Technical Support Associate] and are keen to invite you to join us at IBM for a professional discussion. You will come with (0-3) years of experience, good technical skills and</span><span> fluency in English.</span><span> </span><br /><br /><span>In this role you will be:</span><br /><span>Involved in Providing Voice &amp; E-Mail Technical Help Desk Services support to IBM Internal End Users and External Commercial Account End Users across NA, EMEA &amp; AP.</span><br /><span>Handling inbound calls / emails / chats resolving technical issues for end users.</span><br /><span>Proficient in Connectivity troubleshooting, TCP/IP, Dial-up, Token Ring, Ethernet, LAN/WAN.</span><br /><span>Proficient in Understanding of operating systems, Windows 2000/NT/XP configuration options and troubleshooting.</span><br /><br /><span>Details for Interview at IBM Location:</span><br /><br /><span>Date:</span><span>   30th &amp; 31st March 2017</span><span> </span><br /><br /><span>Time: </span><span>11am- 2pm</span><span> </span><br /><br /><span>Venue:</span><span> IBM India Pvt. Ltd, APIIC Software Layout, Raheja IT Park, 3B Phase 2, Madhapur, Hyderabad, 500081</span><span> </span><br /><br /><span>The dress code for the day is business formals or smart casuals.</span><br /><br /><span>Documents to carry with you: </span><br /><br /><span>Please carry soft copies of the below documents on a USB drive (ensure education docs scanned have all borders visible).</span><br /><br /><span>1. Current company\'s offer or appraisal letter (whichever is the latest) </span><br /><span>2. Experience Letters from two most recent employers.</span><br /><span>3. Last three months pay slips (with passwords, if any) </span><br /><span>4. Updated Resume </span><br /><span>5. A Govt. ID proof </span><br /><span>6. Copy of your highest education mark sheets (All years/ semesters) </span><br /><span>7. Copy of your highest education (Degree Certificate / Convocation Certificate). </span></p>\r\n<p><span><span>On the day you visit us for the discussion, carry a print out of this e-mail along with an Original Govt. Approved Photo ID document (PAN Card/ Voters ID/ Driving License) for security purposes to enter the IBM premises (please be aware photocopies will not be accepted). Request you to carry an updated resume (hardcopy) along with you</span></span></p>','Padmaja ','IBM',11,1,0,1493596800,1490870057,1491379779,2,2,1),(10,'errer','<p>rrrge</p>','errrrrrrh','erre',42,1,0,1493510400,1490957919,1491379779,2,2,1),(11,'Avantcha\'s supply chain management','<h1 class=\"MainTitle\">CASE STUDY: Avantcha\'s supply chain management</h1>\r\n<p></p>\r\n<p></p>\r\n<p><strong>According to a report issued by the organisers of the International Tea &amp; Coffee Festival, more than 19,000kg of tea is consumed across the UAE each day, ranking second only to water as the most commonly consumed beverage. The country is also the world’s largest re-exporter of tea.</strong></p>\r\n<p></p>\r\n<p>Home-grown business Avantcha is working to capitalise on tea’s popularity and its philosophy is based around sourcing the best world blends – direct from source – to create a portfolio of whole leaf teas and herbal infusions, which it packages in the UAE.</p>\r\n<p></p>\r\n<p>“Our mission is to nurture the tea culture in the region and showcase the sheer diversity of this much-loved beverage,” says Markus Zbinden, who co-founded Avantcha his wife Marina.</p>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<div><img alt=\"Marina and Markus Zbinden, founders of luxury tea purveyor Avantcha.\" src=\"http://www.arabiansupplychain.com/pictures/300x200/Marina-and-Markus-Zbinden.jpg\" border=\"0\" /></div>\r\n<p></p>\r\n<p></p>\r\n<p></p>\r\n<p>The company, founded in 2014, works with organic certified international tea growers to create its 130 blends and its growing list of Dubai clients include award-winning gourmet retailer Jones the Grocer, where diners can also purchase Avantcha blends, Icons Café Couture, Tom &amp; Serg, and The Sum Of Us. Avantcha’s iced tea blends are also on the menu at Abu Dhabi restaurant ROGO’S.</p>\r\n<p></p>\r\n<p>The brand ventured into the world of e-commerce in May, having fast-tracked its website development so that it can sell 50 of its most popular blends online in the UAE, with a view to broadening the online range to all 130 blends.</p>\r\n<p></p>\r\n<p>New teas are added to the online store every month, so by the end of 2015 Avantcha should have the same offer for its retail clients as it does for its hospitality clients.</p>\r\n<p></p>\r\n<p>Positioned as a high-end, boutique brand, sourcing is a key consideration, as Markus explains: “Whenever possible, we source tea from organic tea gardens. Refusing to compromise on quality is something that we adhere to at all times, and so this means that if we can’t source the highest quality of a specific tea in organic form, then we will go for a conventional tea, but one that we know is grown, nurtured and harvested to the highest international standards.</p>\r\n<p></p>\r\n<p>“The conventional teas that we source always undergo stringent pesticide residue tests in line with our commitment to quality. Our repacking unit in Jebel Ali is also organic certified by a German accredited certification body, which adds a further seal of quality to the process and to our end product.”</p>\r\n<p></p>\r\n<p>Avantcha leases two temperature controlled warehouses in Dubai that have air-conditioning units in operation 24/7, keeping the temperature at 20 degrees Celsius. This is strictly monitored and temperatures are recorded.</p>\r\n<p></p>\r\n<p>Discussing the space, Marina comments: “Our total warehouse area covers around 2,000 sq ft. Our speciality products are of high value and have an expiry date between six months and two years; our product rotation is fairly fast due to client demand, and we are using the space to a maximum.”</p>\r\n<p>The company sources its products from tea gardens around the world, in Japan, China, Taiwan, India, Nepal, Sri Lanka and Kenya, with the company’s herbal varieties coming from Europe, North Africa, South Africa and Argentina.</p>\r\n<p>“The next destination on our list is Kyoto and this summer we will also be travelling to Darjeeling in the north of India,” Markus reveals.</p>\r\n<p></p>\r\n<div><img alt=\"New teas are added to the online store every month. \" src=\"http://www.arabiansupplychain.com/pictures/300x200/Avantcha-Tea.jpg\" border=\"0\" /></div>\r\n<p></p>\r\n<p>Marina admits it can be challenging to source an ingredient or a specific tea, sharing: “Since it is a 100% natural product some varieties can only be harvested once a year, and this is also dependent on the climate during that specific period.</p>\r\n<p>“One of our main challenges when we first set up Avantcha was the approvals and logistics required to import our products from so many countries; this required a lot of complex procedures and time, but we are now past this phase and it is usually a smooth operation that simply needs structured planning and organisation.”</p>\r\n<p>Detailing Avantcha’s frei methods, the couple tell Logistics Middle East that procedures vary depending on how urgently the company we need the product to reach Dubai.</p>\r\n<p>“This is obviously linked to consumer demand. We use both sea freight and air freight. We also work with local agents to facilitate the customs clearing process,” Markus shares.</p>\r\n<p>Marina comments: “We receive deliveries every month. Although tea has a longer shelf life than other foodstuffs, averaging around two to three years, we are committed to ensuring that we provide tea that is as fresh as possible.</p>\r\n<p>“We also offer seasonal teas that are only harvested over a two to three-day period annually, so this requires careful planning from a logistics standpoint. All our teas are transported and packaged either vacuumed packed or air sealed to ensure that quality of product is maintained throughout the shipping process and so we can provide our customers with a guaranteed fresh tea blend.”</p>\r\n<p></p>\r\n<p>Addressing how Avantcha maintains excellence throughout the supply chain, Marina says: “Our suppliers have to replicate the same high standards that our brand has become synonymous with.</p>\r\n<p>“Communication is integral, maintaining excellent relationships with all our suppliers is crucial and attaining good industry partnerships are fundamental. Performance has to be at an optimum level to ensure the delivery of first class products.”</p>\r\n<p>International expansion is part of Avantcha’s mid to long-term market development strategy, with active clients already secured in Oman, Bahrain, Saudi Arabia and Kenya. Markus says: “Looking further ahead, from our roots here in Dubai we are looking to penetrate the GCC market and then build an international tea brand.”</p>\r\n<p></p>\r\n<div><img alt=\"Marina and Markus Zbinden, founders of luxury tea purveyor Avantcha.\" src=\"http://www.arabiansupplychain.com/pictures/300x200/Marina-and-Markus-Zbinden_1.jpg\" border=\"0\" /></div>\r\n<p></p>\r\n<p>Marina adds: “We will be looking at Europe and the US. The fact that our products comply with European regulations is a first step in taking Avantcha to a global audience.”</p>\r\n<p>Reflecting on launching a new beverage line in the competitive UAE market, Markus muses: “We’ve lived in Dubai for nine years and have seen the city and the country blossom with many successful stories of ‘home-grown’ brands.</p>\r\n<p>“The UAE has enough imported brands, so we thought why not give Dubai something back in the form of its first locally created luxury tea brand?</p>\r\n<p>“Tea is the world’s second favourite beverage but people still know relatively little about it and the different types of tea available today so end-user education is really important – and an ongoing challenge – as well as the need to raise the awareness of the general public about the availability of superior quality teas, compared to your usual cup. This requires a solid marketing strategy and detailed explanation.”</p>\r\n<p>Asked what attracted them to the niche sector in the firstplace, Markus concludes: “The world of tea is a very complex one and that was part of the attraction for us in the beginning from the cultural differences in enjoying the beverage; the more than 1,000 varieties and the numerous regions of the world that all have a tea-growing history. I once read that all tea comes from a single plant, and I wanted to learn more about this. Tea has also helped shape world history and been a pioneer in innovation such as the era of the tea clipper ships, which took global trade in a completely new direction.”</p>','Sarah Jacotine on Oct 10, 2015 ','Sarah Jacotine',1,1,0,1493942400,1491377242,1492008876,2,2,1),(12,'INTERVIEW: Oliver Klingbeil, MD, S.A. TALKE','<p><em>Oliver Klingbeil is managing director of S.A. TALKE.</em></p>\r\n<p><strong>Tell me about your main activities</strong> S.A. TALKE Ltd. is a joint venture company between the TALKE group from Germany, the SISCO group from Jeddah (Western Province) and the Al-Jabr group from Jubail (Eastern Province). The TALKE group has 68 years of industry experience in the logistics of chemicals and petrochemicals with more than 2,300 staff working in 16 countries across Europe, the Middle East, India and China. In 2003 S.A. TALKE made a pioneering move when entering into the first on-site outsourcing relationship in the region in this sector. Our main focus is to provide high quality logistic services for chemical and petrochemical manufacturers in Saudi Arabia, with safety as top priority.</p>\r\n<p>Our three main business segments are: logistics, covering storage and logistic solutions for harmless and hazardous products, container terminals, and value-added services; logistic solutions, encompassing logistic analysis and consultancy, optimisation of logistics processes and turnkey construction of logistics plants; and transportation solutions, meaning individual transport solutions for bulk liquids, dry bulk and packed products.</p>\r\n<p><strong>What is S.A. TALKE focusing on currently? </strong> We always focus on providing a high quality service, retaining business and developing long-term partnerships with clients. While we are part of a global organisation, we tailor our services to suit the local needs of our customers. Quality is the cornerstone of our success and safety is a non-negotiable priority – S.A TALKE achieved 2.5 million safe man-hours in 2014.</p>\r\n<p></p>\r\n<div><img alt=\"Oliver Klingbeil, managing director of S.A. TALKE.\" src=\"http://www.arabiansupplychain.com/pictures/300x200/OliverKlingbeil.jpg\" border=\"0\" /></div>\r\n<p></p>\r\n<p><strong>What were other big achievements in 2014? </strong> Last year marked our tenth anniversary in Saudi Arabia. and we successful completed our first operational year of the Portside Logistics Facility at Jubail Commercial Port, which is one of our biggest projects, and the operational start-up of our third liquid product handling project in the Kingdom for Saudi Kayan – NDA (Natural Detergent Alcohol). Lastly, our major achievement of 2014 is the positive acknowledgement we received on our existing quality and performance.</p>\r\n<p><strong>What are the benefits of operating in Saudi? </strong> Besides the sunny blue sky and the warm weather, the benefit of operating in an emerging market like Saudi Arabia is that a company like S.A. TALKE has now become a pioneer in setting high quality standards in all aspects of the petrochemical logistics industry.</p>\r\n<p><strong>Do you have any comment on Saudi Arabia rising from ninth to second in the 2015 Agility Emerging Markets Index, beaten only by China? </strong> It’s not such a big surprise that China beat Saudi Arabia to the top spot because the Chinese market is more mature and diversified then the Saudi market. But having said that, the future of the Saudi market is very bright. As we know, Saudi Arabia is the world’s largest producer and exporter of oil, and has one quarter of the world’s known oil reserves – more than 260 billion barrels.Being the world’s largest producer and exporter of oil, Saudi Arabia plays a unique role in the global energy industry. Its policies on the production and export of oil, natural gas and other petroleum products have a major impact on the emerging markets, as well as the global economy.</p>\r\n<p></p>\r\n<p><strong>How easy do you find it to do business in Saudi Arabia and how important is it for foreign companies to find a suitable local business partner? </strong> For any foreign company that is planning to do business in Saudi Arabia, it is necessary to invest time and money in conducting proper market research in order to lay down the foundations for their business. Once that is established, it is imperative to find a local partner who matches your business criteria and shares a similar long-term vision.</p>\r\n<p>It is also essential for foreign companies to study the norms, business codes and laws of Saudi Arabia as these are very strictly enforced. Observing the laws and traditions are also important in building good working relationships. In the case of S.A. TALKE, our bond with our local partners (SISCO group from Jeddah and the Al-Jabr group from the Eastern Province) is built upon mutual respect and trust and this is the main reason that we are constantly growing together.</p>\r\n<p></p>\r\n<p><strong>How do you think Saudi Arabia is perceived by the international business community? </strong> Fom a business prospective it is a mixed bag because Saudi Arabia has strong traditional and religious roots that sometimes influence the way business is conducted here. For example, during the holy month of Ramadan, companies have to respect the local regulations and manage their work accordingly.</p>\r\n<p>On the whole, as Saudi Arabia is diversifying and expanding into different businesses globally, the international business community is looking at it as an emerging market with tremendous potential. I recently had the opportunity to represent S.A. TALKE at the Saudi-German Business Forum held in Riyadh in March 2015, and it was very encouraging to see more than 250 German and Saudi high-ranking company representatives as well as the government taking part.</p>\r\n<p><strong>Why do you think has the logistics industry in the Kingdom not developed as much as the manufacturing and FMCG industries have? </strong> The landscape of Saudi Arabia is harsh and covered by the timeless sand but despite this fact the logistics industry has gone through several phases, and it has developed since the first discovery of oil in 1960s. This is the reason that today there are many large scale infrastructure projects currently underway and the upcoming Saudi Rail network will further enhance the logistics segment in the Kingdom.</p>\r\n<p>Now, if we compare the FMCG industry to the logistic industry in Saudi Arabia, it has to fill the gaps of the logistic industry by creating more educational platforms to further develop the expertise within the logistics industry. This is the key reason S.A. TALKE is focused on offering career development and educational programmes to its employees at all levels. Furthermore we are also planning to develop an academy for logistics with support from the German Chamber of Industry and Commerce in order to make this segment more attractive and to retain local Saudi talent.</p>\r\n<p><strong>How do you attract &amp; retain a talented workforce? </strong> Our focus is not only to retain our existing talent but to recruit new talent by offering competitive benefits and attractive career development programmes. This is the reason S.A. TALKE is actively participating in several local career fairs and why we established an internal steering committee that focuses on enhancing the skills of talented personnel of all nationalities. We are always looking to recruit new talent at all levels. Our job postings are advertised through various sources and all candidates can apply through our web job portal (or email hr@s-a-talke.com).</p>\r\n<p><strong>What challenges are faced by the chem &amp; petchem logistics industry in the GCC? </strong> One of the main challenges in the Saudi market for the chemical and petrochemical logistics industry is related to the lack of expertise. This industry is extremely sensitive due to the nature of the products and experienced logistics service providers are a must. Along the same lines, the transportation of dangerous goods on the road is a major concern where many trucking companies do not have the right equipment and do not have proper driver training. We are committed to the GPCA Gulf SQAS programme which we believe will help improve this situation. Last but not least, the availability of a rail network in the future should be an important improvement for the industry.</p>\r\n<p><strong>Where are the growth areas? </strong> Obviously we have seen a huge growth in this sector in the past decade with so many new plants coming on stream in the region. Many of these have been commodity plastic plants, which have been key to our growth and the development of outsourcing in the sector. Now we are in an era that is bringing greater specialty chemical production and demands even higher levels of know-how. This is ideal for us as a group as it is our area of specialisation. So after years of more and more quantity, we are now being able to focus on providing higher quality.</p>\r\n<p><strong>How have falling oil prices affected your business? </strong> The falling oil prices have obviously affected our customers because of the impact on their sales prices. Generally we have seen that production here in the region has continued pretty much on the same level and the impact is felt more throughout the supply chain as the product is often being stored for longer periods or sold in other markets. So, the key for us is to remain flexible and support our customers wherever we can.</p>\r\n<p><strong>What trends in the chemical and petrochemical industries are impacting your logistics activities? </strong> As mentioned, the launch of Gulf SQAS standards in the GCC has created a new wave of positive change and we feel sure it will transform the way the transportation and warehousing companies operate. This is building on the success of SQAS in Europe and is a key development, and one which the TALKE group has supported. We are proud that two of our GCC locations were part of the GPCA’s pilot project.</p>\r\n<div>\r\n<p><strong>What are your immediate expansion plans? </strong> S.A. TALKE will start operations in the Western Province of Saudi Arabia in 2015, and we have plans to expand our infrastructure and operations in the Eastern Province.</p>\r\n<p><strong>How would you describe your leadership style? </strong> It has been close to five years since I joined S.A.TALKE and my leadership style has evolved from being a visionary leader to a more coaching leader. However, if you ask my team, they will tell you that I am a coaching leader who is result driven. To further explain from another angle, I like to say that our employees are our biggest asset, who I believe are at the heart of our existence. I strongly believe that the success of any company depends on the success of its employees and as a leader it’s my duty to support and encourage my team and where necessary, to run the extra mile with them so they can attain higher goals.</p>\r\n<p>I always make an effort to lead by an example and therefore I have an open door policy, which encourages a free dialog with my team members. This allows me to keep myself engaged with the team at all times and to integrate them into the decision making process.Today I am proud to say, that despite the challenges, thanks to the hard work and dedication from our employees to enhance our competitiveness, the company achieved good results in 2014. This is the core reason that we are growing rapidly and the number of our employees crossed 900 last year. By mid-2015 we will be operating with more than 1,200 employees.</p>\r\n<p></p>\r\n<p><strong>What do you enjoy about working in logistcs?</strong> After being in logistics for more than 30 years, I can confidently say that I enjoy the fact every day is a new challenge – there are no dull moments.</p>\r\n<p><strong>What three tips would you share for becoming the boss? </strong> From my personal and professional experience I would recommend the following: believe in continuous learning, never say ‘no’ to new challenges, and be respectful to all while having some flexibility, especially when working in culturally diverse environments.</p>\r\n<p><strong>Lastly, what does success mean to you?</strong> Success should not only be measured by numbers; it should include the loyalty and day-to-day accomplishments of the team members who continue to shape up the organisation with their hard work. Of course, there is more to success than just doing business – our success and confidence is built upon the positive feedback from our customers on our customer satisfaction surveys, which we aim to increase through the quality of our services and show our commitment to all of our customers.</p>\r\n<a title=\"Oliver Klingbeil, managing director of S.A. TALKE.\" class=\"lightbox\" href=\"http://www.arabiansupplychain.com/pictures/OliverKlingbeil.jpg\" rel=\"article_photos\"><br class=\"Apple-interchange-newline\" /></a></div>\r\n<p></p>','Lara','fb',16,1,1,1493942400,1491386294,1491992678,2,2,1),(13,'Test interview','<p>interview content without image</p>','Leo','Fourbends',10,1,1,1493942400,1491395924,1491828484,2,2,1),(14,'I12','<p>i12</p>','i12','i12',12,1,1,1494547200,1491991359,1491992128,2,2,1),(15,'i3','<p>i3</p>','i3','i3',61,1,0,1494547200,1491992825,1491993217,2,2,1),(16,'i4','<p>i4</p>','i4','i4',4,1,0,1494547200,1491993342,1491993416,2,2,1),(17,'Test Interview','<p>Test View Content</p>','test contact','test company',1,1,0,1494547200,1491994030,1492000347,2,2,1),(18,'Specialist','<div class=\"grid-27 alpha fl\">\r\n<div class=\"box mb0\" id=\"jdDiv\">\r\n<div id=\"apply_career\" class=\"oh\">\r\n<div class=\"ptb20 hLine\">\r\n<div class=\"f14 lh18 alignJ disc-li\">\r\n<h2 class=\"jobDescriptionHeading \">Job Description</h2>\r\n</div>\r\n<div class=\"f14 lh18 alignJ disc-li\">- Worked on Production systems <br /><br />- Experience with Database Migration, Installation, Upgrades and Patching <br /><br />- Data center understanding <br /><br />- Knowledge of Other RDBMS is a Plus <br /><br />- Experience in PL/ SQL and worked on ER Diagrams. <br /><br />- Working Knowledge<br /><br />Salary: Not Disclosed by Recruiter<br />Industry: <a title=\"Find all jobs matching IT Software\" href=\"https://www.naukri.com/it-software-jobs\">IT-Software </a>/ <a title=\"Find all jobs matching Software Services\" href=\"https://www.naukri.com/software-services-jobs\">Software Services</a><br />Functional Area: <a title=\"Find all jobs matching IT Software Other\" href=\"https://www.naukri.com/it-software-other-jobs\">IT Software - Other</a><br />Role Category: Programming &amp; Design<br />Role: Team Lead/Technical Lead<br />Keyskills:\r\n<div class=\"cl\"><span><a class=\"tag\" title=\"Find all jobs matching C\" href=\"https://www.naukri.com/c-jobs\">C</a>, </span><span><a class=\"tag\" title=\"Find all jobs matching Python\" href=\"https://www.naukri.com/python-jobs\">Python</a>, </span><span><a class=\"tag\" title=\"Find all jobs matching Six Sigma\" href=\"https://www.naukri.com/six-sigma-jobs\">Six Sigma</a>, </span><span><a class=\"tag\" title=\"Find all jobs matching PMP\" href=\"https://www.naukri.com/pmp-jobs\">PMP</a>, </span><span><a class=\"tag\" title=\"Find all jobs matching .NET\" href=\"https://www.naukri.com/dot-net-jobs\">.NET</a>, </span><span><a class=\"tag\" title=\"Find all jobs matching HTML\" href=\"https://www.naukri.com/html-jobs\">HTML</a>, </span><span><a class=\"tag\" title=\"Find all jobs matching JavaScript\" href=\"https://www.naukri.com/javascript-jobs\">JavaScript</a>, </span><span><a class=\"tag\" title=\"Find all jobs matching SQL\" href=\"https://www.naukri.com/sql-jobs\">SQL</a>, </span><span><a class=\"tag\" title=\"Find all jobs matching Oracle\" href=\"https://www.naukri.com/oracle-jobs\">Oracle</a>, </span><span><a class=\"tag\" title=\"Find all jobs matching assembly language\" href=\"https://www.naukri.com/assembly-language-jobs\">assembly language</a>, </span><a class=\"tag\" title=\"Find all jobs matching Real Time Operating Systems\" href=\"https://www.naukri.com/real-time-operating-systems-jobs\"><span>Real Time Operating Systems</span></a></div>\r\n</div>\r\n</div>\r\n<div class=\"ptb20 hLine\">\r\n<div class=\"cTitle f16 lh30\">\r\n<h3 class=\"jobDesiredProfileHeading\">Desired Candidate Profile</h3>\r\n</div>\r\n<div class=\"f14 lh18 disc-li\"> <br />Education:UG -B.Tech/B.E. - Computers<br />PG - M.Tech - Computers</div>\r\n</div>\r\n<div class=\"ptb20\">\r\n<div class=\"cTitle f16 lh30\">\r\n<h4 class=\"jobCompanyProfileHeading\">Company Profile</h4>\r\n</div>\r\n<div class=\"f14 lh18 alignJ\">HCL Technologies</div>\r\n<div class=\"f14 lh18 alignJ\">HCL Technologies Limited is an Indian multinational IT services company, headquartered in Noida, Uttar Pradesh, India. It is a subsidiary of HCL Enterprise.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Vijayaraman','HCL',1,1,0,1497744000,1494591581,1494606173,2,2,1),(19,'Operations/supply Chain LINC Fellow (part-time Faculty/lecturer)','<div id=\"id_titleBar\" class=\"floatleft\">\r\n<div id=\"id_title\" class=\"floatleft titleFixed cls_fixed_bar\">\r\n<div class=\"search_head\" id=\"id_search_head\">\r\n<div class=\"compname\">\r\n<div class=\"left_comp\">\r\n<h2>LINC Education</h2>\r\n</div>\r\n<div class=\"clear\">LINC is seeking experienced faculty members in the field of Operations and Supply Chain Management from leading colleges and universities.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"jobdescription pull-left\">\r\n<div class=\"jobdescriptioninside\">\r\n<p><br />As an experienced Business Faculty Member (LINC Fellow), the candidate will teach students in Masters-level programs studying at premier Australian universities.</p>\r\n<pre><br />The role will be part-time (15-20 hours per week) with scheduled weekend availability.\r\n</pre>\r\n<ul>\r\n<li>LINC Fellows will be actively engaged when a unit (subject) is assigned. A unit will range from 7 to 14 weeks at a time.</li>\r\n<li>LINC Fellows are required to be available for 2-3 hrs each afternoon (between noon to 5 pm) to call students every day when they are supporting them on a unit.</li>\r\n<li>LINC Fellows are also required to be available between 12 noon pm to 6 pm each day to respond to student emails.</li>\r\n<li>Candidate will have the flexibility to work from the location of his/her convenience.</li>\r\n</ul>\r\n<pre><span><br />What\'s on offer </span><br /><br />The role offers a competitive remuneration between INR 30,000-50,000 per month (based on committed weekly time, batch size and experience level of the LINC Fellow) when actively engaged, plus performance-based incentives.<br /><br />The professional benefits include:</pre>\r\n<ul>\r\n<li>Interacting with high-quality global university faculty.</li>\r\n<li>Working with a diverse range of international students.</li>\r\n<li>Developing a deeper subject understanding.</li>\r\n<li>Gaining richer academic exposure.</li>\r\n<li>Improving interpersonal and cross-cultural skills.</li>\r\n</ul>\r\n<pre> \r\n<span>Desired candidate profile:</span></pre>\r\n<ul>\r\n<li>PG/Doctoral degree in Operations Management, Supply Chain Management, Logistics Management or related discipline.</li>\r\n<li>Those who can teach courses in Operations Management, Supply Chain Management, Production Management, Logistics or Industrial Engineering are especially encouraged to apply.</li>\r\n<li>5-10 years of corporate experience and/or teaching experience/Research in the field of Operations or Supply Chain at a leading university or college</li>\r\n<li>Experience as an Operation and/or Supply Chain professional.</li>\r\n<li>Empathetic, ambitious, warm and outgoing personality willing to work closely with people from diverse culture</li>\r\n<li>Proficient in the English language</li>\r\n<li>Must possess a working laptop and have access to high-speed ( &gt;2 MBPS) stable internet connection</li>\r\n<li>Ability to quickly learn and use technology platforms for interacting with students including host university\'s Learning Management System and LINC\'s technology platform (training on these platforms will be provided)</li>\r\n</ul>\r\n<p>Perks and Benefits</p>\r\n<p>The role offers a competitive remuneration between INR 30,000-50,000 per month (based on committed weekly time, batch size and experience level of the LINC Fellow) when actively engaged, plus performance-based incentives.</p>\r\n</div>\r\n</div>','www.linceducation.com','LINC Education',2,1,1,1587340800,1574151790,1583224748,2,2,0),(20,'Walkin | Sr Executive | Supply Chain Management | 10th & 11th March','<h2>Job description</h2>\r\n<div class=\"dang-inner-html\">\r\n<div><b><span style=\"text-decoration: underline;\">JD for Sr. Executive SCM</span></b></div>\r\n<div><span style=\"text-decoration: underline;\"><b> </b></span></div>\r\n<div>The Supply chain management executive should know the end to end supply chain process<br />* Good in product sourcing and good with supplier negotiation skills.<br />* Should be able to handle 15-20 centers independently for demand-supply planning, stock reports consolidations and<br />MIS.<br />* Should have good analytical skills.<br />* Should be good in follow up for supplier invoices from suppliers and NP centers.<br />* Should be good in communication oral &amp; written.<br />* Should be good in Excel and MIS.<br />* Should be a good team player and flexible for working hours.<br />* Plan and implement the overall supply chain strategy<br />* Collaborate with Sales, Operations, and Customer Service teams<br />* Build and maintain good relationships with vendors</div>\r\n<div></div>\r\n<div>Venue for Interview:</div>\r\n<div><b>NephroPlus,</b></div>\r\n<div>West Wing, 1st floor, Punnaiah Plaza, Above SBI Bank, Road Number 2, Banjara Hills, Hyderabad, Telangana 500034</div>\r\n<div></div>\r\n<div>Contact Person:</div>\r\n<div>Srikanth - HR</div>\r\n</div>\r\n<div class=\"other-details\">\r\n<div class=\"details\">\r\n<p>RolePurchase Executive<br />Industry TypeMedical, Healthcare, Hospitals<br />Functional AreaPurchase / Logistics / Supply Chain<br />Employment TypeFull Time, Permanent<br />Role CategoryPurchase/Material Management<br />Education<br />UG :Any Graduate in Any Specialization<br />PG :Any Postgraduate in Any Specialization<br />Doctorate :Doctorate Not Required, Any Doctorate in Any Specialization</p>\r\n</div>\r\n</div>','Srikanth - HR','Nephrocare Health Services Pvt. Ltd.',1,1,1,1586649600,1583220566,1583220566,2,2,0);
