INSERT INTO `scwxm_local_scwvideos` VALUES (1,'What is Supply Chain Management','Part 1 of 12 - This module introduces viewers to the field of supply chain management. \r\nIt describes the complex supply chain of a simple product, a bottle of water. \r\nThe video also illustrates the importance of supply chain managers and their skill sets in our modern global economy for both manufacturing and service industries. \r\nIn defining supply chain management, the video also hopes to educate and inspire business students, young and old, about the opportunities available to those with supply chain management degrees.\r\n\r\nThis is the first installment in Arizona State University\'s twelve-part introduction to supply chain management video series. ASU, \r\nthe W. P. Carey School of Business, and the Supply Chain Management Department are proud and happy to share this video series with supply chain management departments, \r\nsupply chain instructors, career specialists in high schools and universities, \r\nas well as industry leaders in an effort to inspire a new generation of supply chain management professionals across the country and around the world. ','1','<p><a href=\"@@PLUGINFILE@@/Test.mp4\">Test.mp4</a></p>',1,2,1,1,1490286385,1494592585,2,2,1,0),(2,'Module 2 Buy It Managing Supply ASU-WPC-SCM','Part 2 of 12 Part introduction to purchasing, part homage to the 1970s Time for Timer You are What You Eat public service announcement, this module explains the critical role supply management plays in producing high quality products and services. Procurement managers require a specific set of varied skills to ensure your supply chain has a continuous flow of healthy materials from dependable suppliers.\r\n\r\nThis is the 2nd installment in Arizona State University\'s twelve-part introduction to supply chain management video series developed by Eddie Davila, Jeff Hough, Randy Cates, Dawn Feldman, Dan Ichikawa, Ian Schmoel, and Matt Hardy. ASU, the W. P. Carey School of Business, and the Supply Chain Management Department are proud and happy to share this video series with supply chain management departments, supply chain instructors, career specialists in high schools and universities, as well as industry leaders in an effort to inspire a new generation of supply chain management professionals across the country and around the world. ','1','<p><a href=\"http://www.youtube.com/v/zYbtZ0x9_SA\">Module 2: Buy It: Managing Supply (ASU-WPC-SCM)</a></p>',1,2,1,0,1490356225,1492008789,2,2,1,0),(3,'Test Video','Test Video Description','1','<p><a href=\"@@PLUGINFILE@@/azhar.mp4\">azhar.mp4</a></p>',1,7,1,1,1491994931,1492008826,2,2,1,0),(4,'Test Video 2','Test Video description 2','1','<p><a href=\"http://www.youtube.com/v/J83WLLzqT0w\">Labor Saving Devices Wet Noodle Wire Fishing Kit</a></p>',1,7,1,0,1491995121,1491995121,2,2,1,0),(5,'Testing - Please ignore','dfhdfh','1','<p class=\" firepath-matching-node\">hshhsgh</p>',1,14,1,0,1494315102,1494315102,2,2,1,0),(6,'testing - igmore','gdhdfgh','1','<p>hghghsgfhgfhsfghfg</p>',1,14,1,1,1494317907,1494317907,2,2,1,0),(7,'please ignore','dsfgdfg','1','<p>jgjgjg</p>',1,12,1,1,1494327738,1494327738,2,2,1,0),(8,'Communication','Two-way process of reaching mutual understanding, in which participants not only exchange (encode-decode) information, news, ideas and feelings but also create and share meaning. In general, communication is a means of connecting people or places. In business, it is a key function of management--an organization cannot operate without communication between levels, departments and employees.\r\n','1','<p><a href=\"http://www.youtube.com/v/dKzl_82PbU4\">4 Things to Practice daily to Improve Communication Skills | Communication Tips | TalentSprint</a><a href=\"http://www.youtube.com/v/dKzl_82PbU4\"><br /></a></p>',1,4,1,1,1494592707,1494592707,2,2,1,0),(9,'Why do we need IOT','IoT ConsultingWith the rapid developments in the IoT (Internet of Things) technology in the past 10 years, the number of IoT devices have increased exponentially. Industries no longer need human intervention for monitoring, alerting, analyzing data and many other endless applications. What is IoT?\r\nIoT (Internet of Things) is a system, consist of multiple devices, each device assigned a unique Id, connected to a common network, sharing information over a secure channel without a human to human or human to computer interaction.\r\n\r\nBenefits of IoT\r\n1. The most important benefit of any IoT product is to minimize the approximation and maximize the accuracy with more granularity of the information.\r\n2. Immediate Access to the real-time data on the computer screen with all the possible graphs and charts for better use in the analytics.\r\n3. Reading information using various sensors that can be installed at the places where human access is not possible.\r\n\r\nOur Expertise in IoT Technology\r\nWith an excellent experience in real-world IoT projects, our IoT Software development team focuses on IoT device management\r\nby building complex solutions using Internet Gateways and embedding them with all types of hardware devices to send data over the secure channel\r\nto the IoT platform. We chose suitable IoT communication protocols for quick and reliable communications ensuring the atomicity and integrity of your IoT device.\r\n\r\n\r\nOur main focus is to use our IoT experience in developing custom solutions as per the customer requirements and deliver an impeccable system.\r\nOur standards of IoT Software development ensure the quality of the product without compromising the IoT security.\r\n\r\n','1','<p>video content<a href=\"http://www.youtube.com/v/UrwbeOIlc68\">IoT Tutorial for Beginners | Internet of Things (IoT) | IoT Training | IoT Technology | Edureka</a></p>',1,1,1,1,1519130891,1583222004,2,2,0,0),(10,'Power Management Systemmm','The purpose of this product is to monitor the power parameters fetched from the meter and display to end user. Using this product user can monitor basic parameters of voltage, current, power, KVA, frequency, and power factor of various locations by placing an appropriate meter.\r\n\r\nThe information got from the meter is\r\n•	Processed to our needs.\r\n•	Stored securely for future use.\r\n•	Fetched whenever needed. the \r\n•	Generated into reports.\r\n•	Exported to CSV, Excel, and PDF as the user wish.\r\n\r\nOne of the most important features in this product is Alert notification, Users are alerted (communicated) with mail or SMS as soon as the value from the meter goes high or low with the standard parameters set within the website by the user. \r\n\r\nThe four major feature of this product is the dashboard, manage DG, settings and manage users.\r\n\r\nThe dashboard is a page which displays the processed information which is fetched from the meter from various locations. Using the processed information we show more attractive graphs and charts which gives more statistics to the user. \r\n\r\nManage DG is the page used for listing the current Active/Inactive DGs installed with the meter. The user has the ability to update DG parameters like fuel settings and B-check.\r\n\r\nSettings page holds the minimum and maximum values from the meter for which the alert has to be triggered to the list of users who will receive the alerts as soon as the value from the meter goes high or low with the standard parameters set within the website by the user.  \r\n\r\nManage users, as the name indicates this page is used for managing the users and the permissions they have in the page. This page lets the Super admin to add new users and set appropriate functionalities for them.\r\nYou can find more details of these features below.\r\n','1','<p><a href=\"@@PLUGINFILE@@/Sony%20Ericsson%20Elm%20video%20sample.mp4.mp4\">Sony%20Ericsson%20Elm%20video%20sample.mp4.mp4</a></p>',1,2,1,1,1583240937,1583240937,2,2,0,0);
