INSERT INTO `scwxm_message_read` VALUES (40,2,2,'Moodle updates are available (http://4blabs.com/scw)','Update notifications\n\nThere is a newer Moodle version available!\nMoodle 3.2.8+ (Build: 20180329) Version 2016120508.01 (Stable version)\nMoodle 3.3.5+ (Build: 20180329) Version 2017051505.02 (Stable version)\nMoodle 3.4.2+ (Build: 20180329) Version 2017111302.03 (Stable version)\n\nSee http://4blabs.com/scw/admin/index.php for more details\n\nIt is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.\n\nYour Moodle site http://4blabs.com/scw is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in the Site administration section of the Administration block. You can customise the delivery of this message via your preferences page.\n',2,'<h1>Update notifications</h1>\n<h2>There is a newer Moodle version available!</h2>\n<ul>\n<li><strong>Moodle 3.2.8+ (Build: 20180329)</strong> Version 2016120508.01 (Stable version)</li>\n<li><strong>Moodle 3.3.5+ (Build: 20180329)</strong> Version 2017051505.02 (Stable version)</li>\n<li><strong>Moodle 3.4.2+ (Build: 20180329)</strong> Version 2017111302.03 (Stable version)</li>\n</ul>\n<p>See <a href=\"http://4blabs.com/scw/admin/index.php\">http://4blabs.com/scw/admin/index.php</a> for more details</p>\n<p>It is strongly recommended that you update your site to the latest version to obtain all recent security and bug fixes.</p>\n<footer><p style=\"font-size:smaller; color:#333;\">Your Moodle site <a href=\"http://4blabs.com/scw\">http://4blabs.com/scw</a> is configured to automatically check for available updates. You are receiving this message as the administrator of the site. You can disable automatic checks for available updates in the Site administration section of the Administration block. You can customise the delivery of this message vi