INSERT INTO `scwxm_page` VALUES (1,3,'SELF-DIRECTED','<p><span>The APICS CSCP Learning System offers a variety of resources to help you prepare for the CSCP exam. The self-directed format allows you to work at your own pace where and when it’s convenient. The robust learning features of Learning System’s printed, e-book, and online course components provide guidance and reinforcement of supply chain concepts learned throughout the study program.</span></p>',1,'<p>The APICS CSCP Learning System offers a variety of resources to help you prepare for the CSCP exam. The self-directed format allows you to work at your own pace where and when it’s convenient. The robust learning features of Learning System’s printed, e-book, and online course components provide guidance and reinforcement of supply chain concepts learned throughout the study program.</p>\r\n<p></p>\r\n<p></p>\r\n<div class=\"wpb_row wf-container\" data-anchor=\"#instructor_led\" id=\"instructor_led\" row-effect-mobile-disable=\"true\">\r\n<div class=\"vc_col-sm-4 wpb_column column_container \">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"dt-fancy-separator title-left h4-size accent-title-color\">\r\n<div class=\"dt-fancy-title bg-on\">Who should choose the self-directed format?<span class=\"separator-holder separator-right\"></span></div>\r\n</div>\r\n<div class=\"vc_empty_space\"></div>\r\n<div class=\"standard-arrow list-divider\">\r\n<ul>\r\n<li>Have very busy and/or unpredictable schedules and therefore need a flexible study option.</li>\r\n<li>Prefer to study on their own, at their own pace.</li>\r\n<li>Have the commitment and drive to stay on track with their studies.</li>\r\n<li>Do not have access to APICS CSCP Learning System instructor-led classes.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"vc_col-sm-4 wpb_column column_container \">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"vc_empty_space\"></div>\r\n<div class=\"dt-fancy-separator title-left h4-size accent-title-color\">\r\n<div class=\"dt-fancy-title bg-on\"><span class=\"separator-holder separator-left\"></span>Benefits<span class=\"separator-holder separator-right\"></span></div>\r\n</div>\r\n<div class=\"vc_empty_space\"></div>\r\n<div class=\"standard-arrow list-divider\">\r\n<ul>\r\n<li>Complete the course at your own pace.<span></span></li>\r\n<li>Study when and where your schedule allows.<span></span></li>\r\n<li>Develop an individualized study plan.<span></span></li>\r\n<li>Avoid travel expenses and time away from work.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"vc_col-sm-4 wpb_column column_container \">\r\n<div class=\"wpb_wrapper\">\r\n<div class=\"vc_empty_space\"></div>\r\n<div class=\"dt-fancy-separator title-left h4-size accent-title-color\">\r\n<div class=\"dt-fancy-title bg-on\"><span class=\"separator-holder separator-left\"></span>What\'s included?<span class=\"separator-holder separator-right\"></span></div>\r\n</div>\r\n<div class=\"vc_empty_space\"></div>\r\n<div class=\"standard-arrow list-divider\">\r\n<ul>\r\n<li>Comprehensive reading materials in printed and PDF reader formats.</li>\r\n<li>Access to interactive online study tools, quizzes and tests.</li>\r\n<li>Online access for one year from purchase.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',1,0,NULL,5,'a:2:{s:12:\"printheading\";s:1:\"1\";s:10:\"printintro\";s:1:\"0\";}',2,1493136134);
/*!40000 ALTER TABLE `scwxm_page` ENABLE KEYS */;
UNLOCK TABLES;

