INSERT INTO `scwxm_user_details` VALUES (1,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,'307376699','303165345','supply manager,sales',1,'Seeking an Entry-Level Position Within the Renewable-Energy Sector.\r\n\r\nRecent BSEE graduate and EIT with experience as an electrical engineer intern for a major solar power solutions manufacturer. Possess the analytical abilities and technical skills necessary for engineering innovative designs and applications. Solid understanding of electrical engineering theory, industry-standard circuit design, testing tools and photovoltaic (PV) systems.',1,'zbSaDT5U',1,NULL,1488610073,1489214873,NULL,NULL,4,1,1,1,2,'<p><em><strong>Test a word</strong></em></p>',1,'','',NULL),(2,1,NULL,NULL,'other','Developing','other','IT',NULL,NULL,NULL,1,'80929786',NULL,NULL,1,'Extensive experience in humanitarian logistics management within the field of supply chain management (procurement, tendering, contracting, clearance, transport, warehousing, etc.) fleet management and asset management, distribution support.\r\nProven record on the ability and experience of the management of logistics team on a senior level.  fsdf',1,'mPj1qkmj',1,NULL,1488612250,1489217050,NULL,NULL,5,1,1,2,2,'',1,'','',NULL),(3,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,'740906084',NULL,NULL,1,'Upcoming graduate of ABET-accredited bachelor\'s-degree program seeking an entry-level aerospace engineer position. Completed flight test internship with XYZ Company and assisted in research study that examined methods for improving Boeing 737 flight acoustics. Academic studies have provided a foundation in aerodynamics and physics; structural dynamics; systems design and testing; flight mechanics and controls; and 2D and 3D CAD design tools.\r\n',1,'8leOSXTj',1,NULL,1488612569,1489217369,NULL,NULL,6,1,1,1,3,'',1,NULL,NULL,NULL),(4,1,NULL,NULL,'demand-forecast-planning',NULL,'education',NULL,NULL,NULL,NULL,1,'729525688',NULL,NULL,1,'Managed the global demand analysis and forecast for products worth $3M, including the company\'s fastest growing categories. Assisted Buyers/Supply planners to manage inventory. Maintained and reported forecast KPIs, such as forecast accuracy, bias and MAPE. Identified excess inventory ($80K) and developed a sales plan jointly with the Sales management to sell that inventory and thus reducing the total inventory costs by 6%. Managed all aspects of demand analysis and forecasting contributing to increased profit (11% to 18%). Developed and implemented analytical tools using MS to help the planners in day-to-day activities, resulting in increased forecast accuracy by 12%.',1,'THzlSqR8',1,NULL,1488630353,1489235153,NULL,NULL,7,1,1,1,1,'',1,NULL,NULL,NULL),(5,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,'89350742',NULL,NULL,1,'Upcoming graduate of ABET-accredited bachelor’s in civil engineering program. Backed by successful internship experience and knowledge of engineering theories, principles, specifications and standards. Plan to earn Engineer in Training certification upon graduation. Demonstrated 3D skills with the ability to design site layouts from concept through completion. Proficient user of AutoCAD Civil 3D, MicroStation and ArcGIS. Knowledge of Sometown, MI Municipalities Planning Code and zoning, subdivision and storm water ordinances.',1,'fZmv1qOD',1,NULL,1488630828,1489235628,NULL,NULL,8,1,1,1,1,'',1,NULL,NULL,NULL),(6,1,NULL,NULL,'sourcing',NULL,'education',NULL,NULL,NULL,NULL,1,'933258398',NULL,NULL,1,'As a HR Sourcing Specialist/Recruiter, Collaborate with recruiters to understand specific position requirements, job responsibilities and how they relate to business goals. Screen and qualify prospective candidates and provide feedback to the recruitment team. Support the Recruitment Team by recruiting candidates from online databases and social networks as well as passive, qualified candidates through networking, cold calling, internet searches and research. Create a pipeline of internal and external candidates for corporate and international positions. Gain a clear understanding of our business units and associated staffing needs to anticipate and plan for current and future sourcing activities. Design, develop and execute sourcing strategies that align with the business group’s staffing objectives, both short and long-term. Partnering with other recruiting team members to align qualified candidates with appropriate positions and work with them through the selection process.\r\n',1,'IA5XoOPz',1,NULL,1488633220,1489238020,NULL,NULL,9,1,1,1,1,'',1,'','',NULL),(7,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,NULL,'124777717','Php, mysql',1,'Junior Web developer able to build a Web presence from the ground up -- from concept, navigation, layout and programming to UX and SEO. Skilled at writing well-designed, testable and efficient code using current best practices in Web development. Fast learner, hard worker and team player who is proficient in an array of scripting languages and multimedia Web tools.',1,'IORM3CrR',1,NULL,1488633522,1489238322,NULL,NULL,10,1,1,1,1,'',1,'','',NULL),(8,1,NULL,NULL,'sourcing',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,1,'As a Strategic Sourcing Manager, Manage contracting and supplier relationship activities for a multi-million dollar healthcare category.\r\nDeveloped sourcing plan for a new service; drafted negotiation plans and executed SOWs and contract resulting in $2.6M in savings.\r\nEvaluated and managed suppliers using scorecards, dashboards and facilitating quarterly business reviews. Conducted RFPs and RFQs to identify qualified suppliers and negotiate best rates.',1,'8uiwd7qc',1,NULL,1488684537,1489289337,NULL,NULL,11,1,1,1,1,NULL,1,NULL,NULL,NULL),(9,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,NULL,NULL,NULL,1,'College junior majoring in manufacturing engineering technology who is highly motivated to secure a design engineer internship. Honors student with practical work experience within the manufacturing sector; technical skills in AutoCAD, SolidWorks and Creo Elements/Pro; and a foundation in automated manufacturing systems and simulation modelling techniques.',1,'lxmXLGhI',1,NULL,1488684642,1489289442,NULL,NULL,12,1,1,1,1,NULL,1,NULL,NULL,NULL),(10,1,NULL,NULL,'supply-chain-education',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'',1,'Lead programmer with a track record of incorporating user and business requirements into cost-effective, secure and user-friendly solutions known for scalability and durability. ',1,'imHMmdGd',1,NULL,1488765655,1489370455,NULL,NULL,13,1,1,1,1,NULL,1,NULL,NULL,NULL),(11,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,NULL,NULL,NULL,1,'Seeking an Entry-Level Position Within the Renewable-Energy Sector. Recent BSEE graduate and EIT with experience as an electrical engineer intern for a major solar power solutions manufacturer. Possess the analytical abilities and technical skills necessary for engineering innovative designs and applications. Solid understanding of electrical engineering theory, industry-standard circuit design, testing tools and photovoltaic (PV) systems.',1,'UQq2EUMe',1,NULL,1488765876,1489370676,NULL,NULL,14,1,1,1,1,NULL,1,NULL,NULL,NULL),(12,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,NULL,'467972610','sdf',1,'Quality-focused manufacturing engineer offering a broad knowledge of manufacturing processes, experience using Creo Elements/Pro and SolidWorks 2010 and keen process-development skills gained through completion of capstone project with a leading auto-parts manufacturer. Bachelor’s in manufacturing engineering program provided a strong educational foundation in the following engineering areas: Product Engineering & Quality, Engineering Drawing; Engineering Graphics Using Solid Modeling; Design of Jigs, Fixtures & Tooling; Quality Engineering; Lean Manufacturing Systems; Six Sigma Tools',1,'ODTvfWtB',1,NULL,1488886544,1489491344,NULL,NULL,19,1,1,1,2,'',1,'','',NULL),(13,1,NULL,NULL,'supply-chain-education',NULL,'education',NULL,NULL,NULL,NULL,1,'335911517',NULL,NULL,1,'Lead programmer with a track record of incorporating user and business requirements into cost-effective, secure and user-friendly solutions known for scalability and durability. ',1,'1VBM8xLS',1,NULL,1488891995,1489496795,NULL,NULL,20,1,1,1,1,'',1,NULL,NULL,NULL),(14,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,NULL,NULL,NULL,1,'Recent graduate of ABET-accredited BSME program seeking an entry-level mechanical engineering position.\r\nKey skills and knowledge areas:\r\nSolid command of technologies, tools and best practices in designing mechanical equipment using AutoCAD, SolidWorks and engineering drawings.Excellent shop and safety skills honed from work as a machinist and welder. Able to design and fabricate tooling and mechanical test fixtures.Strong team collaboration skills. Work closely with team members to achieve engineering goals.​',1,'2BI7jLcz',1,NULL,1488950708,1489555508,NULL,NULL,21,1,1,1,1,NULL,1,NULL,NULL,NULL),(15,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,0,NULL,NULL,NULL,1,'Seeking an Entry-Level Position with a Software Solutions Provider\r\nBSISE graduate with CAPM certification and experience as an engineering project manager intern. Proven success in managing project scopes, budgets, schedules and deliverables throughout all phases of the software development lifecycle. Combine technical and analytical aptitudes with problem-solving strengths to drive projects to on-time, on-budget and high-quality completion.Exceptional focus on customer service and passion for working in a customer-facing role, while building partnerships with stakeholders across the company.\r\nProficient in MS Project, MS Excel, AutoCAD, C, C++, Oracle and Windows Server.',1,'V2OSc5lJ',1,NULL,1488958188,1489562988,NULL,NULL,22,1,1,1,1,NULL,1,NULL,NULL,NULL),(16,1,NULL,NULL,'supply-chain-education',NULL,'education',NULL,NULL,NULL,NULL,1,'201480651',NULL,NULL,1,'Dedicated Educator with extensive experience developing curriculum and delivering exceptional educational excellence in Secondary Education. Key Strengths: Talent for inspiring students to higher levels of academic success. Dynamic and engaging; establish and maintain lasting rapport with instructional assistants and para-educators, teachers, building administrators, and parents.',1,'v7Khupl0',1,NULL,1488972145,1489576945,NULL,NULL,23,1,1,1,1,'',1,NULL,NULL,NULL),(17,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,NULL,NULL,NULL,1,'As an Entry-Level Mechanical Designer, CAD & CAE Tools: AutoCAD, SolidWorks, FEMtools and TurboCAD. BSET student offering experience using CAD and CAE tools, a foundation in 2D/3D modeling and structural design, and a drive for performance excellence.\r\nHands-on experience creating mechanical design drawings using SolidWorks and configuring components using AutoCAD. Academic career distinguished by Dean’s List honors and extracurricular leadership success.',1,'4Mvs2aEG',1,NULL,1488973488,1489578288,NULL,NULL,24,1,1,1,1,NULL,1,NULL,NULL,NULL),(18,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,NULL,NULL,NULL,1,'Analytical research scientist with more than two years of experience contributing to tissue-engineered research studies for products that improve lives through regenerative medicine. Background includes participation in groundbreaking research in the areas of tissue engineering, cell biology and protein biochemistry. Experience running bio essays and laboratory bench studies, writing scientific reports and maintaining research lab operations and equipment.',1,'6mCcse3m',1,NULL,1489052711,1489657511,NULL,NULL,25,1,1,1,1,NULL,1,NULL,NULL,NULL),(19,1,NULL,NULL,'inventory',NULL,'education',NULL,NULL,NULL,NULL,1,'481364571',NULL,NULL,1,'Practiced knowledge about various tasks involved in inventory management. Introduced work processes which improved inventory control and eliminated the discrepancies.\r\n',1,'KIIhnLdr',1,NULL,1489053687,1489658487,NULL,NULL,26,1,1,1,1,'',1,NULL,NULL,NULL),(20,2,NULL,NULL,NULL,NULL,NULL,NULL,0,50.00,NULL,1,NULL,'629535016','RRRR',1,'Dedicated researcher offering excellence in molecular biology techniques, including DNA sample preparation, quantitation and sequencing. Familiar with SQL and ISIS, protein expression and purification techniques. Background includes providing scientific input during the development and execution of clinical trialsin both medical-research and clinical-testing facilities. Proven ability to organize, prioritize and assist with multiple research projects and comply with GCP, ICH and FDA standards. Stay up-to-date in the field of clinical pathology through participation in professional lab organizations and review of current research topics.',1,'zbSaDT5U',1,NULL,1488610073,1489214873,NULL,NULL,3,1,0,1,1,'',1,'','',NULL),(21,2,NULL,NULL,NULL,NULL,NULL,NULL,1,50.00,NULL,1,'217557549',NULL,NULL,1,'Hardworking, entry-level chemist offering a year of lab-testing experience within the FDA- and cGMP-regulated environment of health and beauty products manufacturing. In-depth knowledge of wet chemistry and titration methods; experience using instrumentation such as AA, FTIR, HPLC, GC and ICP.\r\nTechnically proficient – advanced user of Mathematica, Spartan\'10 and GAMESS.',1,'K5uqyrBq',1,NULL,1489071398,1489676198,1489072417,1489076017,27,1,1,1,1,'',1,NULL,NULL,NULL),(22,1,NULL,NULL,'supply-chain-management-for-marketing',NULL,'education',NULL,NULL,NULL,NULL,1,'630781574',NULL,NULL,1,'Dedicated customer service manager with 15+ years of experience in \"big box\" retail and food service settings. Consistently achieve record-high customer satisfaction rankings, improvements to the bottom line and turnaround of underperforming operations. Respected builder and leader of customer-focused teams; instill a shared, enthusiastic commitment to customer service as a key driver of company goal attainment. Lead by example and ensure the execution of all safety, security, quality and store operations policies. ',1,'hxONdEMl'